// src/components/SignUp.jsx
import React, { useState } from 'react';
import { signup } from '../services/authServices'; // Directly importing the signup function

const SignUp = () => {
  const [formData, setFormData] = useState({
    username: '',
    coor_email: '',
    coor_password: '',
    coor_role: 'Coordinator',
  });
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await signup(formData); // Directly calling signup function
      setSuccess('Sign up successful!');
      setError(null);
    } catch (error) {
      setError(error.message);
      setSuccess(null);
    }
  };

  return (
    <div>
      <h2>Sign Up</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {success && <p style={{ color: 'green' }}>{success}</p>}
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="username"
          value={formData.username}
          onChange={handleChange}
          placeholder="Username"
          required
        />
        <input
          type="email"
          name="coor_email"
          value={formData.coor_email}
          onChange={handleChange}
          placeholder="Email"
          required
        />
        <input
          type="password"
          name="coor_password"
          value={formData.coor_password}
          onChange={handleChange}
          placeholder="Password"
          required
        />
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
};

export default SignUp;
